INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('6', '1', 'Delivery Information', '&lt;div style=&quot;margin: 0px; outline: none; line-height: 13px; box-sizing: border-box; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px;&quot;&gt;\r\n&lt;p style=&quot;margin: 0px 0px 20px; outline: none; line-height: 1.4; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;Please read delivery information carefully before placing the order to avoid any confusion later on and make sure that the information regarding address and telephone of the recipient provided by you is correct.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 20px; outline: none; line-height: 1.4; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; color: rgb(128, 0, 0);&quot;&gt;&lt;strong style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;Delivery Areas&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: verdana, geneva, sans-serif; font-size: 13px; line-height: 13px;&quot;&gt;Free Shipping to any where in India&lt;/span&gt;&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 20px; outline: none; line-height: 1.4; box-sizing: border-box;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 20px; outline: none; line-height: 1.4; box-sizing: border-box;&quot;&gt;&lt;strong style=&quot;color: rgb(165, 42, 42); line-height: 1; font-family: verdana, geneva, sans-serif; margin: 0px; outline: none; box-sizing: border-box;&quot;&gt;Delivery Time : With in 24 hr&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 20px; outline: none; line-height: 1.4; box-sizing: border-box;&quot;&gt;&lt;strong style=&quot;font-family: verdana, geneva, sans-serif; line-height: 1; margin: 0px; outline: none; box-sizing: border-box;&quot;&gt;Delivery Confirmation&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;After the successful delivery you will receive an email from us confirming that your gift has been delivered.&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;Please make sure to enter a valid email address and contact number while placing the order to ensure that you receive the confirmation.&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;You can also check the status of your order at any time using online Order Tracking on the site which will be updated as soon as the mail is sent to you.&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;The delivery confirmation email will have the name of the receiver and the time of delivery in cases where it is available.&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;In some cases where the signature is not legible, the email will just inform that your order has been delivered.&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;We don’t get the delivery confirmation just after the delivery, please wait till 6 pm as deliveries can be made until this time (at peak times - could be later).&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;In cases where Pod (Proof of Delivery) does not come same day, you will receive the confirmation email next day but that does not imply that the order has not been delivered.&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;We will intimate you by email in case of attempted delivery, refused and returned by receiver or any other case which results into non-delivery.&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 20px; outline: none; line-height: 1.4; box-sizing: border-box;&quot;&gt;&lt;span style=&quot;margin: 0px; outline: none; line-height: 1; box-sizing: border-box; font-family: verdana, geneva, sans-serif;&quot;&gt;Remember, if you have any questions do not hesitate to contact us directly.&lt;/span&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('4', '1', 'About Us', '&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;Vizagcart.com&lt;/strong&gt;&amp;nbsp;is a young and vibrant company started on&amp;nbsp;&lt;strong&gt;13&lt;sup&gt;th&lt;/sup&gt;&amp;nbsp;August,2014&lt;/strong&gt;&amp;nbsp;that aims to provide Good quality branded products.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;Vizagcart&lt;/strong&gt;&amp;nbsp; is also Vizag’s first&amp;nbsp;&lt;u&gt;&lt;strong&gt;Online&lt;/strong&gt;&lt;/u&gt;&amp;nbsp;and&amp;nbsp;&lt;u&gt;&lt;strong&gt;Offline&lt;/strong&gt;&lt;/u&gt;&amp;nbsp;&lt;strong&gt;shopping site&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;Vizagcart.com&lt;/strong&gt;&amp;nbsp;caters to the trending needs of&amp;nbsp;&lt;strong&gt;Electronics&lt;/strong&gt;, &lt;strong&gt;Groceries&lt;/strong&gt;, &lt;strong&gt;Solar&lt;/strong&gt;,&amp;nbsp;&lt;strong&gt;Men&lt;/strong&gt;, &lt;strong&gt;Women, Baby&lt;/strong&gt; and &lt;strong&gt;Kids&lt;/strong&gt;, &lt;strong&gt;Home&lt;/strong&gt; and &lt;strong&gt;Kitchen&lt;/strong&gt;, etc.. Apart from other online shopping site Vizagcart is specially associated with solar equipments like &lt;strong&gt;Solar portable products&lt;/strong&gt;, &lt;strong&gt;solar water heater&lt;/strong&gt;, &lt;strong&gt;solar powered home&lt;/strong&gt;, &lt;strong&gt;solar water pumps&lt;/strong&gt;, &lt;strong&gt;solar fencing&lt;/strong&gt;, &lt;strong&gt;solar street lights&lt;/strong&gt; etc..&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;Vizagcart.com&lt;/strong&gt;&amp;nbsp;would give its customers best value, best products and the best available service in the industry.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;Honesty towards our customers, principals and our associates would be the pillar on which Vizagcart would stand and grow.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;Vizagcart.com&lt;/strong&gt;&amp;nbsp;we strive to achieve the highest level of&amp;nbsp;&lt;strong&gt;“&lt;/strong&gt;&lt;strong&gt;Customer Satisfaction&lt;/strong&gt;&lt;strong&gt;”&lt;/strong&gt;&amp;nbsp;possible. Our cutting edge E-commerce platform, highly experienced team, and state of the art customer care centre provides customer with Broader selection of products, Superior buying experience, On-time delivery of products, Quick resolution of any concerns&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;You can reach us at&amp;nbsp;&lt;strong&gt;+91&amp;nbsp;8297-247-365&amp;nbsp;&lt;/strong&gt;, [&lt;u&gt;Simply Remember as (+91 8297 24 7 365)&lt;/u&gt;],&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 0891-6003111&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;Our Customer services are available at&amp;nbsp;&lt;strong&gt;24×7&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;We guarantee on time delivery and best quality.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&lt;strong&gt;HAPPY&amp;nbsp; SHOPPING!!!!!!!&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('5', '1', 'Terms &amp; Conditions', '&lt;p&gt;&lt;strong&gt;Vizagcart&amp;nbsp; terms of use&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;Please read the following terms and conditions very carefully as your use of service is subject to your acceptance of and compliance with the following terms and conditions (&quot;Terms&quot;).&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;This document is an electronic record in terms of Information Technology&amp;nbsp;Act, 2000 and rules there under as applicable and the amended provisions&amp;nbsp;pertaining to electronic records in various statutes as amended by the&amp;nbsp;Information Technology Act, 2000. This electronic record is generated&amp;nbsp;by a computer system and does not require any physical or digital&amp;nbsp;signatures.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;This document is published in accordance with the provisions of Rule 3&amp;nbsp;(1) of the Information Technology (Intermediaries guidelines) Rules,&amp;nbsp;2014 that require publishing the rules and regulations, privacy policy and&amp;nbsp;Terms of Use for access or usage of www.vizagcart.com website.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;1. Introduction&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;a)&lt;/strong&gt;&amp;nbsp;&lt;a href=&quot;http://www.vizagcart.com/&quot;&gt;www.vizagcart.com&lt;/a&gt;&amp;nbsp;(&quot;Website&quot;) is an Internet based content and e-commerce portal licensed by&amp;nbsp;SS Eco Power Solutions, a company incorporated under the laws of India.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;b)&lt;/strong&gt; Use of the Website is offered to you conditioned on acceptance without modification of all the terms, conditions and notices contained in these Terms, as may be posted on the Website from time to time. vizagcart.com at its sole discretion reserves the right not to accept a User from registering on the Website without assigning any reason thereof&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;2. User Account, Password, and Security&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;You will receive a password and account designation upon completing the Website\'s registration process. You are responsible for maintaining the confidentiality of the password and account, and are fully responsible for all activities that occur under your password or account. You agree to (a) immediately notify vizagcart.com of any unauthorized use of your password or account or any other breach of security, and (b) ensure that you exit from your account at the end of each session. vizagcart.com cannot and will not be liable for any loss or damage arising from your failure to comply with this Section 2&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;3. Membership Eligibility&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Use of the Website is available only to persons who can form legally binding&amp;nbsp;contracts under Indian Contract Act, 1872. Persons who are &quot;incompetent to contract&quot; within the meaning of the Indian Contract Act, 1872 including minors,&amp;nbsp;un-discharged insolvents etc. are not eligible to use the Website. If you are&amp;nbsp;a minor i.e. under the age of 18 years, you shall not register as a User of the&amp;nbsp;vizagcart website and shall not transact on or use the website. As a minor if you wish to use or transact on website, such use or transaction may be made by your&amp;nbsp;legal guardian or parents on the Website. Vizagcart reserves the right to terminate&amp;nbsp;your membership and / or refuse to provide you with access to the Website if it is&amp;nbsp;brought to Vizagcart’s notice or if it is discovered that you are under the age of 18&amp;nbsp;years.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;4. Platform for Transaction and Communication&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;The Website is a platform that Users utilize to meet and interact with one another&amp;nbsp;for their transactions. Vizagcart is not and cannot be a party to or control in any&amp;nbsp;manner any transaction between the Website\'s Users.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Henceforward:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. All commercial/contractual terms are offered by and agreed to between Buyers&amp;nbsp;and Sellers alone. The commercial/contractual terms include without limitation price, shipping costs, payment methods, payment terms, date, period and mode&amp;nbsp;of delivery, warranties related to products and services and after sales services&amp;nbsp;related to products and services. Vizagcart does not have any control or does not&amp;nbsp;determine or advise or in any way involve itself in the offering or acceptance of&amp;nbsp;such commercial/contractual terms between the Buyers and Sellers.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;2. Vizagcart does not make any representation or Warranty as to specifics (such&amp;nbsp;as quality, value, salability, etc) of the products or services proposed to be sold&amp;nbsp;or offered to be sold or purchased on the Website. Vizagcart does not implicitly or&amp;nbsp;explicitly support or endorse the sale or purchase of any products or services on&amp;nbsp;the Website. Vizagcart accepts no liability for any errors or omissions, whether on&amp;nbsp;behalf of itself or third parties.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;3. Vizagcart is not responsible for any non-performance or breach of any contract&amp;nbsp;entered into between Buyers and Sellers. Vizagcart cannot and does not guarantee&amp;nbsp;that the concerned Buyers and/or Sellers will perform any transaction concluded&amp;nbsp;on the Website. Vizagcart shall not and is not required to mediate or resolve any&amp;nbsp;dispute or disagreement between Buyers and Sellers.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;4. Vizagcart does not make any representation or warranty as to the item-specifics&amp;nbsp;(such as legal title, creditworthiness, identity, etc) of any of its Users. You are&amp;nbsp;advised to independently verify the bona fides of any particular User that You&amp;nbsp;choose to deal with on the Website and use Your best judgment in that behalf.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;5. Vizagcart does not at any point of time during any transaction between Buyer&amp;nbsp;and Seller on the Website come into or take possession of any of the products or&amp;nbsp;services offered by Seller nor does it at any point gain title to or have any rights&amp;nbsp;or claims over the products or services offered by Seller to Buyer.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;6. At no time shall Vizagcart hold any right, title or interest over the products nor&amp;nbsp;shall Vizagcart have any obligations or liabilities in respect of such contract entered&amp;nbsp;into between Buyers and Sellers. Vizagcart is not responsible for unsatisfactory or&amp;nbsp;delayed performance of services or damages or delays as a result of products&amp;nbsp;which are out of stock, unavailable or back ordered.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;7. The Website is only a platform that can be utilized by Users to reach a larger&amp;nbsp;base to buy and sell products or services. Vizagcart is only providing a platform for&amp;nbsp;communication and it is agreed that the contract for sale of any of the products&amp;nbsp;or services shall be a strictly bipartite contract between the Seller and the Buyer.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;At no time shall Vizagcart hold any right, title or interest over the products&amp;nbsp;nor shall Vizagcart have any obligations or liabilities in respect of such contract.&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart is not responsible for unsatisfactory or delayed performance of services&amp;nbsp;or damages or delays as a result of products which are out of stock, unavailable&amp;nbsp;or back ordered.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;8. You shall independently agree upon the manner and terms and conditions of&amp;nbsp;delivery, payment, insurance etc. with the seller(s) that You transact with.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;Disclaimer:&lt;/strong&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;&amp;nbsp;Pricing on any product(s) as is reflected on the Website may due&amp;nbsp;to some technical issue, typographical error or product information published by seller may be incorrectly reflected and in such an event seller may cancel such&amp;nbsp;your order(s).&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;9. You release and indemnify Vizagcart and/or any of its officers and&amp;nbsp;representatives from any cost, damage, liability or other consequence of any of&amp;nbsp;the actions of the Users of the Website and specifically waive any claims that you&amp;nbsp;may have in this behalf under any applicable law. Notwithstanding its reasonable&amp;nbsp;efforts in that behalf, Vizagcart cannot take responsibility or control the information&amp;nbsp;provided by other Users which is made available on the Website. You may find&amp;nbsp;other User\'s information to be offensive, harmful, inconsistent, inaccurate, or&amp;nbsp;deceptive. Please use caution and practice safe trading when using the Website.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please note that there could be risks in dealing with underage persons or people&amp;nbsp;acting under false pretence.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;5. Services Offered&lt;/strong&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart.com provides a number of Internet-based services through the Web Site (all such services, collectively, the &quot;Service&quot;). One such service enables users to purchase original merchandise such as clothing, footwear and accessories from various fashion and lifestyle brands (collectively, &quot;Products&quot;). The Products can be purchased through the Website through various methods of payments offered. The sale/purchase of Products shall be additionally governed by specific policies of sale, like cancellation policy, return policy, etc.&amp;nbsp;and all of which are incorporated here by reference. In addition, these terms and policies may be further supplemented by Product specific conditions, which may be displayed on the webpage of that Product.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;30 Day Replacement Guarantee*&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;The 30 Day Replacement Guarantee seeks to assist Buyers who have been defrauded by qualified sellers on the Website. If at the time of delivery and/or within 30 days from the date of delivery of the product/s, if any defect is found, then the buyer of the product/s can ask for replacement of the product/s from the seller subject to the following terms and conditions:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Notify seller of any defects in the product/s at the time of delivery of the product/s and/or within 30 days from the date of delivery and the same product/s will be replaced in return of the defective product/s.&lt;br /&gt;\r\n2. Replacement can be for the entire product/s or part/s of the product subject to availability of the same with the seller.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Following products shall not be eligible for return or replacement:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;• Damages due to misuse of product;&lt;br /&gt;\r\n• Incidental damage due to malfunctioning of product;&lt;br /&gt;\r\n• Any consumable item which has been used/installed;&lt;br /&gt;\r\n• Products with tampered or missing serial/UPC numbers;&lt;br /&gt;\r\n• Digital products/services (Flyte music downloads)&lt;br /&gt;\r\n• Any damage/defect which are not covered under the manufacturer\'s warranty&lt;br /&gt;\r\n• Any product that is returned without all original packaging and accessories, including the box, manufacturer\'s packaging if any, and all other items originally included with the product/s delivered;&lt;br /&gt;\r\n• Jewelers which is \'made to order\' on customer\'s request&lt;br /&gt;\r\n&lt;br /&gt;\r\nOn Clothing, Footwear and Jewelers, qualified sellers accept 30 day exchange subject to the following conditions:&lt;br /&gt;\r\n&lt;br /&gt;\r\nClothes and footwear are not used (other than for trial), altered, washed, soiled or damaged in any way.&amp;nbsp;&lt;br /&gt;\r\nOriginal tags and packaging should be intact. For items that come in branded packaging, the box should be undamaged.&lt;br /&gt;\r\n\'Made to order\' jewelers, Innerwear, lingerie, socks and clothing freebies are not covered under the return policy.&amp;nbsp;&lt;br /&gt;\r\nDamaged or defective clothing and footwear products are meanwhile covered by the 30 Day Replacement Guarantee.&lt;br /&gt;\r\n&lt;br /&gt;\r\nIf Vizagcart has suspicion or knowledge, that any of its buyers and sellers are involved in any activity that is intended to provide claims or information that is false, misleading or not genuine, then Vizagcart may while reserving its rights to initiate civil and/or criminal proceedings against member may also at its sole discretion suspend, block, restrict, cancel the Display Name of such buyer and seller and /or disqualify that user and any related users from availing protection through this program.&lt;br /&gt;\r\n&lt;br /&gt;\r\nVizagcart reserves its right to initiate civil and/or criminal proceedings against a user who, files a invalid and/or false claims or provides false, incomplete, or misleading information. In addition to the legal proceedings as aforesaid, Vizagcart may at its sole discretion suspend, block, restrict, cancel the Display Name [and its related Display Names] of such user and/or disqualify that user and any related users from availing protection through this program. Any person who, knowingly and with intent to injure, &amp;nbsp;defraud or deceive, files a Fraudulent Complaint containing false, incomplete, or misleading information may be guilty of a criminal offence and will be prosecuted to the fullest extent of the law.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;6. Privacy Policy:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The User hereby consents, expresses and agrees that he has read and fully understands the&amp;nbsp;&lt;a href=&quot;http://www.vizagcart.com/index.php?route=information/information&amp;amp;information_id=3&quot; target=&quot;_blank&quot;&gt;Privacy Policy&lt;/a&gt;&amp;nbsp;of Vizagcart.com. The user further consents that the terms and contents of such Privacy Policy are acceptable to him&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;7. Limited User:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The User agrees and undertakes not to reverse engineer, modify copy, distribute, transmit, display, perform, reproduce, publish, license, create derivative works from, transfer, or sell any information or software obtained from the Website. Limited reproduction and copying of the content of the Website is permitted provided that Vizagcart’s name is stated as the source and prior written permission of Vizagcart.com is sought. For the removal of doubt, it is clarified that unlimited or wholesale reproduction, copying of the content for commercial or non-commercial purposes and unwarranted modification of data and information within the content of the Website is not permitted&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;8. User Conduct and Rules:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;You agree and undertake to use the Website and the Service only to post and upload messages and material that are proper. By way of example, and not as a limitation, you agree and undertake that when using a Service, you will not:&lt;/p&gt;\r\n\r\n&lt;p&gt;(a)&amp;nbsp;&amp;nbsp;Defame, abuse, harass, stalk, threaten or otherwise violate the legal rights of others;&lt;/p&gt;\r\n\r\n&lt;p&gt;(b)&amp;nbsp;&amp;nbsp;Publish, post, upload, distribute or disseminate any inappropriate, profane, defamatory, infringing, obscene, indecent or unlawful topic, name, material or information;&lt;/p&gt;\r\n\r\n&lt;p&gt;(c)&amp;nbsp;&amp;nbsp;upload files that contain software or other material protected by intellectual property laws unless you own or control the rights thereto or have received all necessary consents; you own or control the rights thereto or have received all necessary consents;&lt;/p&gt;\r\n\r\n&lt;p&gt;(d)&amp;nbsp;&amp;nbsp;Upload or distribute files that contain viruses, corrupted files, or any other similar software or programs that may damage the operation of the Website or another\'s computer;&lt;/p&gt;\r\n\r\n&lt;p&gt;(e)&amp;nbsp;&amp;nbsp;Conduct or forward surveys, contests, pyramid schemes or chain letters;&lt;/p&gt;\r\n\r\n&lt;p&gt;(f)&amp;nbsp;&amp;nbsp;download any file posted by another user of a Service that you know, or reasonably should know, cannot be legally distributed in such manner;&lt;/p&gt;\r\n\r\n&lt;p&gt;(g)&amp;nbsp;&amp;nbsp;falsify or delete any author attributions, legal or other proper notices or proprietary designations or labels of the origin or source of software or other material contained in a file that is uploaded;&lt;/p&gt;\r\n\r\n&lt;p&gt;(h)&amp;nbsp;&amp;nbsp;Violate any code of conduct or other guidelines, which may be applicable for or to any particular Service;&lt;/p&gt;\r\n\r\n&lt;p&gt;(i)&amp;nbsp;&amp;nbsp;Violate any applicable laws or regulations for the time being in force in or outside India; and&lt;/p&gt;\r\n\r\n&lt;p&gt;(j)&amp;nbsp;&amp;nbsp;Violate, abuse, unethically manipulate or exploit, any of the terms and conditions of this Agreement or any other terms and conditions for the use of the Website contained elsewhere.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;9. User Warranty and Representation:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The user guarantees, warrants, and certifies that you are the owner of the content which you submit or otherwise authorized to use the content and that the content does not infringe upon the property rights, intellectual property rights or other rights of others. You further warrant that to your knowledge, no action, suit, proceeding, or investigation has been instituted or threatened relating to any content, including trademark, trade name service mark, and copyright formerly or currently used by you in connection with the Services rendered by Vizagcart.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;10. Intellectual Property Rights:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;a) Unless otherwise indicated or anything contained to the contrary or any proprietary material owned by a third party and so expressly mentioned, Vizagcart.com owns all Intellectual Property Rights to and into the Website, including, without limitation, any and all rights, title and interest in and to copyright, related rights, patents, utility models, trademarks, trade names, service marks, designs, know-how, trade secrets and inventions (whether patentable or not), goodwill, source code, meta tags, databases, text, content, graphics, icons, and hyperlinks. You acknowledge and agree that you shall not use, reproduce or distribute any content from the Website belonging to vizagcart.com without obtaining authorization from Vizagcart.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;b) Notwithstanding the foregoing, it is expressly clarified that you will retain ownership and shall solely be responsible for any content that you provide or upload when using any Service, including any text, data, information, images, photographs, music, sound, video or any other material which you may upload, transmit or store when making use of our various Service. However, with regard to the product customization Service (as against other Services like blogs and forums) you expressly agree that by uploading and posting content on to the Website for public viewing and reproduction/use of your content by third party users, you accept the User whereby you grant a non-exclusive license for the use of the same.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;11. Links to Third Party Sites&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Website may contain links to other websites (&quot;Linked Sites&quot;). The Linked Sites are not under the control of Vizagcart.com or the Website and Vizagcart.com is not responsible for the contents of any Linked Site, including without limitation any link contained in a Linked Site, or any changes or updates to a Linked Site. Vizagcart.com is not responsible for any form of transmission, whatsoever, received by you from any Linked Site. Vizagcart.com is providing these links to you only as a convenience, and the inclusion of any link does not imply endorsement by Vizagcart.com or the Website of the Linked Sites or any association with its operators or owners including the legal heirs or assigns thereof. The users are requested to verify the accuracy of all information on their own before undertaking any reliance on such information.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;12. Disclaimer of Warranties and Liability:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;This Website, all the materials and products (including but not limited to&amp;nbsp;software) and services, included on or otherwise made available to you&amp;nbsp;through this site are provided on &quot;as is&quot; and &quot;as available&quot; basis without any&amp;nbsp;representation or warranties, express or implied except otherwise specified in&amp;nbsp;writing. Without prejudice to the forgoing paragraph, Vizagcart does not warrant&amp;nbsp;that:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;• This Website will be constantly available, or available at all; or&lt;/p&gt;\r\n\r\n&lt;p&gt;• The information on this Website is complete, true, accurate or non-misleading.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Vizagcart will not be liable to you in any way or in relation to the Contents of, or&amp;nbsp;use of, or otherwise in connection with, the Website.&amp;nbsp;Vizagcart does not warrant that this site; information, Content, materials, product&amp;nbsp;(including software) or services included on or otherwise made available to You&amp;nbsp;through the Website; their servers; or electronic communication sent from Us are&amp;nbsp;free of viruses or other harmful components.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Nothing on Website constitutes, or is meant to constitute, advice of any kind.&amp;nbsp;All the Products sold on Website are governed by different state laws and if Seller&amp;nbsp;is unable to deliver such Products due to implications of different state laws,&amp;nbsp;Seller will return or will give credit for the amount (if any) received in advance by&amp;nbsp;Seller from the sale of such Product that could not be delivered to You.&lt;/p&gt;\r\n\r\n&lt;p&gt;You will be required to enter a valid phone number while placing an order on the&amp;nbsp;Website. By registering your phone number with us, You consent to be contacted&amp;nbsp;by Us via phone calls and/or SMS notifications, in case of any order or shipment&amp;nbsp;or delivery related updates. We will not use your personal information to initiate&amp;nbsp;any promotional phone calls or SMS.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;Indemnity&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;You shall indemnify and hold harmless Vizagcart, its owner, licensee, affiliates,&amp;nbsp;subsidiaries, group companies (as applicable) and their respective officers ,directors, agents, and employees, from any claim or demand, or actions including&amp;nbsp;reasonable attorneys\' fees, made by any third party or penalty imposed due to or arising out of Your breach of this Terms of Use, privacy Policy and other&amp;nbsp;Policies, or Your violation of any law, rules or regulations or the rights (including infringement of intellectual property rights) of a third party.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;13. Selling:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;As a registered seller, you are allowed to list item(s) for sale on the Website in accordance with the Policies which are incorporated by way of reference in this Terms of Use. You must be legally able to sell the item(s) you list for sale on our Website. You must ensure that the listed items do not infringe upon the intellectual property, trade secret or other proprietary rights or rights of publicity or privacy rights of third parties. Listings may only include text descriptions, graphics and pictures that describe your item for sale. All listed items must be listed in an appropriate category on the Website. All listed items must be kept in stock for successful fulfillment of sales.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The listing description of the item must not be misleading and must describe actual condition of the product. If the item description does not match the actual condition of the item, you agree to refund any amounts that you may have received from the Buyer. You agree not to list a single product in multiple quantities across various categories on the Website. Vizagcart reserves the right to delete such multiple listings of the same product listed by you in various categories.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;14. Services&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Payment&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;While availing any of the payment method/s available on the Website, we will&amp;nbsp;not be responsible or assume any liability, whatsoever in respect of any loss or damage arising directly or indirectly to You due to:&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;1.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Lack of authorization for any transaction/s, or&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;2.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Exceeding the preset limit mutually agreed by You and between&amp;nbsp;&quot;Bank/s&quot;, or&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;3.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Any payment issues arising out of the transaction, or&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;4.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Decline of transaction for any other reason/s&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;All payments made against the purchases/services on Website by you shall be&amp;nbsp;compulsorily in Indian Rupees acceptable in the Republic of India. Website will not facilitate transaction with respect to any other form of currency with respect&amp;nbsp;to the purchases made on Website.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Before shipping / delivering your order to you, Seller may request you to provide&amp;nbsp;supporting documents (including but not limited to Govt. issued ID and address&amp;nbsp;proof) to establish the ownership of the payment instrument used by you for&amp;nbsp;your purchase. This is done in the interest of providing a safe online shopping&amp;nbsp;environment to Our Users.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Further:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Transactions, Transaction Price and all commercial terms such as Delivery,&amp;nbsp;Dispatch of products and/or services are as per principal to principal bipartite contractual obligations between Buyer and Seller and payment facility is merely&amp;nbsp;used by the Buyer and Seller to facilitate the completion of the Transaction. Use&amp;nbsp;of the payment facility shall not render Vizagcart liable or responsible for the non-delivery, non-receipt, non-payment, damage, breach of representations and warranties, non-provision of after sales or warranty services or fraud as regards&amp;nbsp;the products and /or services listed on Vizagcart Website.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;2. You have specifically authorized Vizagcart or its service providers to&amp;nbsp;collect, process, facilitate and remit payments and / or the Transaction Price&amp;nbsp;electronically or through Cash on Delivery to and from other Users in respect&amp;nbsp;of transactions through Payment Facility. Your relationship with Vizagcart is on a&amp;nbsp;principal to principal basis and by accepting these Terms of Use you agree that&amp;nbsp;Vizagcart is an independent contractor for all purposes, and does not have control&amp;nbsp;of or liability for the products or services that are listed on Vizagcart Website&amp;nbsp;that are paid for by using the Payment Facility. Vizagcart does not guarantee the&amp;nbsp;identity of any User nor does it ensure that a Buyer or a Seller will complete a&amp;nbsp;transaction.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;3. You understand, accept and agree that the payment facility provided by&amp;nbsp;Vizagcart is neither a banking nor financial service but is merely a facilitator&amp;nbsp;providing an electronic, automated online electronic payment, receiving payment&amp;nbsp;through Cash On Delivery, collection and remittance facility for the Transactions&amp;nbsp;on the Vizagcart Website using the existing authorized banking infrastructure and&amp;nbsp;Credit Card payment gateway networks. Further, by providing Payment Facility,&amp;nbsp;Vizagcart is neither acting as trustees nor acting in a fiduciary capacity with respect&amp;nbsp;to the Transaction or the Transaction Price.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;15. Payment Facility for Buyers&lt;/strong&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;• You, as a Buyer, understand that upon initiating a Transaction You are&amp;nbsp;entering into a legally binding and enforceable contract with the Seller to&amp;nbsp;purchase the products and /or services from the Seller using the Payment&amp;nbsp;Facility, and You shall pay the Transaction Price through Your Issuing Bank&amp;nbsp;to the Seller using Payment Facility.&lt;/p&gt;\r\n\r\n&lt;p&gt;• You, as a Buyer, may agree with the Seller through electronic&amp;nbsp;communication and electronic records and using the automated features&amp;nbsp;as may be provided by Payment Facility on any extension / increase in the&amp;nbsp;Dispatch and/or Delivery time and the Transaction shall stand amended to&amp;nbsp;such extent. Any such extension / increase of Dispatch / Delivery time or&amp;nbsp;subsequent novation / variation of the Transaction should be in compliance&amp;nbsp;with Payment Facility Rules and Policies.&lt;/p&gt;\r\n\r\n&lt;p&gt;• You, as a Buyer, shall electronically notify Payment Facility using the&amp;nbsp;appropriate Vizagcart Website features immediately upon Delivery or non&amp;nbsp;Delivery within the time period as provided in Policies. Non notification&amp;nbsp;by You of Delivery or non Delivery within the time period specified in&amp;nbsp;the Policies shall be construed as a deemed Delivery in respect of that&amp;nbsp;Transaction. In case of Cash On Delivery transactions, Buyer is not required&amp;nbsp;to confirm the receipt of products or services.&lt;/p&gt;\r\n\r\n&lt;p&gt;• You, as a Buyer, shall be entitled to claim a refund of the Transaction&amp;nbsp;Price (as Your sole and exclusive remedy) in case You do not receive the&amp;nbsp;Delivery within the time period agreed in the Transaction or within the time&amp;nbsp;period as provided in the Policies, whichever is earlier. In case you do not&amp;nbsp;raise a refund claim using Website features within the stipulated time than&amp;nbsp;this would make You ineligible for a refund.&lt;/p&gt;\r\n\r\n&lt;p&gt;• You, as a Buyer, understand that the Payment Facility may not be&amp;nbsp;available in full or in part for certain category of products and/or services&amp;nbsp;and/or Transactions as mentioned in the Policies and hence You may not be&amp;nbsp;entitled to a refund in respect of the Transactions for those products and /or&amp;nbsp;services&lt;/p&gt;\r\n\r\n&lt;p&gt;• Except for Cash On Delivery transaction, refund, if any, shall be made at&amp;nbsp;the same Issuing Bank from where Transaction Price was received.&lt;/p&gt;\r\n\r\n&lt;p&gt;• For Cash On Delivery transactions, refunds, if any, will be made via&amp;nbsp;demand draft in favor of the Buyer (As per registration details provided by&amp;nbsp;the Buyer)&lt;/p&gt;\r\n\r\n&lt;p&gt;• Refund shall be made in Indian Rupees only and shall be equivalent to the&amp;nbsp;Transaction Price received in Indian Rupees.&lt;/p&gt;\r\n\r\n&lt;p&gt;• For electronics payments, refund shall be made through payment facility&amp;nbsp;using NEFT / RTGS or any other online banking / electronic funds transfer&amp;nbsp;system approved by Reserve Bank India (RBI).&lt;/p&gt;\r\n\r\n&lt;p&gt;• Refund shall be conditional and shall be with recourse available to Vizagcart in case of any misuse by Buyer.&lt;/p&gt;\r\n\r\n&lt;p&gt;• Refund shall be subject to Buyer complying with Policies.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;4. Vizagcart reserves the right to impose limits on the number of Transactions or&amp;nbsp;Transaction Price which Vizagcart may receive from on an individual Valid Credit/Debit/ Cash Card / Valid Bank Account/ and such other infrastructure or any&amp;nbsp;other financial instrument directly or indirectly through payment aggregator or through any such facility authorized by Reserve Bank of India to provide enabling&amp;nbsp;support facility for collection and remittance of payment or by an individual Buyer&amp;nbsp;during any time period, and reserves the right to refuse to process Transactions&amp;nbsp;exceeding such limit.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;5. Vizagcart reserves the right to refuse to process Transactions by Buyers with a&amp;nbsp;prior history of questionable charges including without limitation breach of any agreements by Buyer with Vizagcart or breach/violation of any law or any charges&amp;nbsp;imposed by Issuing Bank or breach of any policy.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;6. Vizagcart may do such checks as it deems fit before approving the receipt of/Buyers commitment to pay (for Cash On Delivery transactions) Transaction Price from the Buyer for security or other reasons at the discretion of Vizagcart. As a&amp;nbsp;result of such check if Vizagcart is not satisfied with the creditability of the Buyer or&amp;nbsp;genuineness of the Transaction / Transaction Price, it will have the right to reject&amp;nbsp;the receipt of / Buyers commitment to pay Transaction Price.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;7. Vizagcart may delay notifying the payment confirmation i.e. informing Seller to&amp;nbsp;Dispatch, if Vizagcart deems suspicious or for Buyers conducting high transaction volumes to ensure safety of the Transaction and Transaction Price. In addition,&amp;nbsp;Vizagcart may hold Transaction Price and Vizagcart may not inform Seller to Dispatch&amp;nbsp;or remit Transaction Price to law enforcement officials (instead of refunding the&amp;nbsp;same to Buyer) at the request of law enforcement officials or in the event the&amp;nbsp;Buyer is engaged in any form of illegal activity.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;8. The Buyer and Seller acknowledge that Vizagcart will not be liable for any&amp;nbsp;damages, interests or claims etc. resulting from not processing a Transaction/Transaction Price or any delay in processing a Transaction/Transaction Price&amp;nbsp;which is beyond control of Vizagcart.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;Compliance with Laws:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;9. Buyer and Seller shall comply with all the applicable laws (including without&amp;nbsp;limitation Foreign Exchange Management Act, 1999 and the rules made and notifications issued there under and the Exchange Control Manual as may be&amp;nbsp;issued by Reserve Bank of India from time to time, Customs Act, Information and Technology Act, 2000 as amended by the Information Technology (Amendment) Act 2008, Prevention of Money Laundering Act, 2002 and the rules made there under, Foreign Contribution Regulation Act, 1976 and the rules made there&amp;nbsp;under, Income Tax Act, 1961 and the rules made there under, Export Import&amp;nbsp;Policy of government of India) applicable to them respectively for using Payment&amp;nbsp;Facility and Vizagcart Website.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;Buyer\'s arrangement with Issuing Bank:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;10. All Valid Credit / Debit/ Cash Card/ and other payment instruments are&amp;nbsp;processed using a Credit Card payment gateway or appropriate payment system infrastructure and the same will also be governed by the terms and conditions&amp;nbsp;agreed to between the Buyer and the respective Issuing Bank and payment instrument issuing company.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;11. All Online Bank Transfers from Valid Bank Accounts are processed using the&amp;nbsp;gateway provided by the respective Issuing Bank which support Payment Facility&amp;nbsp;to provide these services to the Users. All such Online Bank Transfers on Payment&amp;nbsp;Facility are also governed by the terms and conditions agreed to between Buyer&amp;nbsp;and the respective Issuing Bank.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;16.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt; Shipping:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Title and risk of loss for all products ordered by you shall pass on to you upon Vizagcart’s shipment to the shipping carrier&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;17. Termination:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;a)&amp;nbsp;&amp;nbsp;Vizagcart.com may suspend or terminate your use of the Website or any Service if it believes, in its sole and absolute discretion that you have breached, violated, abused, or unethically manipulated or exploited any term of these Terms or anyway otherwise acted unethically.&lt;/p&gt;\r\n\r\n&lt;p&gt;b)&amp;nbsp;&amp;nbsp;Notwithstanding Section 17.a above, these Terms will survive indefinitely unless and until Vizagcart.com chooses to terminate them.&lt;/p&gt;\r\n\r\n&lt;p&gt;c)&amp;nbsp;&amp;nbsp; If you or Vizagcart.com terminates your use of the Website or any Service, Vizagcart.com may delete any content or other materials relating to your use of the Service and Vizagcart.com will have no liability to you or any third party for doing so.&lt;/p&gt;\r\n\r\n&lt;p&gt;d)&amp;nbsp;&amp;nbsp;You shall be liable to pay for any Service or product that you have already ordered till the time of Termination by either party whatsoever. Further, you shall be entitled to your royalty payments as per the User License Agreement that has or is legally deemed accrued to you.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;18. Governing Law:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;These terms shall be governed by and constructed in accordance with the laws of India without reference to conflict of laws principles and disputes arising in relation here to shall be subject to the exclusive jurisdiction of the courts at Visakhapatnam.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;19. Severability:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;If any provision of the Terms is determined to be invalid or unenforceable in whole or in part, such invalidity or unenforceability shall attach only to such provision or part of such provision and the remaining part of such provision and all other provisions of these Terms shall continue to be in full force and effect.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;20. Report Abuse:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;As per these Terms, users are solely responsible for every material or content uploaded on to the Website. Users can be held legally liable for their contents and may be held legally accountable if their contents or material include, for example, defamatory comments or material protected by copyright, trademark, etc. If you come across any abuse or violation of these Terms, please report to&amp;nbsp;&lt;a href=&quot;mailto:reportabuse@vizagcart.com&quot;&gt;reportabuse@vizagcart.com&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;21. Vizagcart violation verification (VVV)&lt;/strong&gt;: Reporting Listing Violations&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Vizagcart has put in place Vizagcart violation Verification process so that&amp;nbsp;intellectual property owners could easily report listings that violate their rights.&amp;nbsp;It is in Vizagcart’s interest to ensure that violating products are removed from the&amp;nbsp;site, as they erode Buyer and good Seller trust.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; If you are a Verified Rights Owner and want to report a listing issue, see&amp;nbsp;Vizagcart VVV.&amp;nbsp;Note: Only the intellectual property rights owner can report potentially&amp;nbsp;infringing products or listings through VVV. If you are not the intellectual&amp;nbsp;property rights owner, you can still help by getting in touch with the rights owner and encouraging them to contact us.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; If your listing was removed through VVV, and you believe that your listing&amp;nbsp;was removed in error, please contact us.&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart does not and cannot verify that Sellers have the right or ability to sell&amp;nbsp;or distribute their listed products. However, Vizagcart is committed to removing infringing or unlicensed products once an authorized representative of the rights&amp;nbsp;owner properly reports them to Vizagcart.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;VVV&lt;/strong&gt;&amp;nbsp;works to ensure that item listings do not infringe upon the copyright,&amp;nbsp;trademark or other intellectual property rights of third parties. VVV participants&amp;nbsp;have the ability to identify and request removal of allegedly infringing products&amp;nbsp;and materials.&lt;/p&gt;\r\n\r\n&lt;p&gt;Any person or company who holds intellectual property rights (such as a&amp;nbsp;copyright, trademark or patent) which may be infringed upon by products listed&amp;nbsp;on Vizagcart is encouraged to become a VVV member.&lt;/p&gt;\r\n\r\n&lt;p&gt;Program membership entitles you (Verified Rights Owner) to the&amp;nbsp;following benefits:&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Rapid response by Vizagcart in ending listings reported by you (as the&amp;nbsp;Verified Rights Owner) as allegedly infringing&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Dedicated priority email queues for reporting alleged infringements&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:17.15pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; The ability to obtain identifying information about Vizagcart ‘s users\'&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;How to Become a VVV Member&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;To join the VVV, we require only that you fully complete and email Us a Notice of&amp;nbsp;Infringement form specifying the allegedly infringing listings and the infringed work, complete with an original authorized signature. The information requested&amp;nbsp;by the Notice of Infringement is designed to ensure that parties reporting products are authorized by the rights owners, and to enable Vizagcart to easily&amp;nbsp;identify the material or listing to be ended.&lt;/p&gt;\r\n\r\n&lt;p&gt;In the interest of keeping the process easy and simple, after we receive your first&amp;nbsp;Notice of Infringement in hard copy, future notices can be sent to Us by email at&amp;nbsp;vizagcart@gmail.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;Note: In your notice of infringement, you shall be required to identify the&amp;nbsp;individual listing which is infringing your intellectual property. General notices&amp;nbsp;shall not be accepted.&lt;/p&gt;\r\n\r\n&lt;p&gt;We are happy to receive such information, but must advise that we may be&amp;nbsp;limited in Our ability to respond to your request absent formal notice from an authorized rights owner.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Notice of Infringement&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;SS Eco Power Solutions&lt;/p&gt;\r\n\r\n&lt;p&gt;_______________________&lt;/p&gt;\r\n\r\n&lt;p&gt;_______________________&lt;/p&gt;\r\n\r\n&lt;p&gt;I,&amp;nbsp;[name]&amp;nbsp;____________________________&amp;nbsp;of&amp;nbsp;[address]&amp;nbsp;_________________________ do solemnly and sincerely declare as follows:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;span style=&quot;line-height: 1.6em;&quot;&gt;1. I am the owner of certain intellectual property rights, said owner being named&amp;nbsp;__________________ (&quot;IP Owner&quot;).&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;2. I have a good faith belief that the item listings or materials identified in the&amp;nbsp;annexure attached hereto are not authorized by the above IP Owner, its agent, or&amp;nbsp;the law and therefore infringe the IP Owner\'s rights. Please expeditiously remove&amp;nbsp;or disable access to the material or products claimed to be infringing.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. I may be contacted at:&lt;/p&gt;\r\n\r\n&lt;p&gt;Name ___________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;Title&amp;nbsp;&amp;amp; Company&amp;nbsp;________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;Address _________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;Email&amp;nbsp;(correspondence)&amp;nbsp;___________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;Telephone/Fax&amp;nbsp;_____________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;Date&amp;nbsp;_________________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;and I make this declaration conscientiously believing it to be true and correct.&lt;/p&gt;\r\n\r\n&lt;p&gt;Declared by&amp;nbsp;______________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;on&amp;nbsp;[date]&amp;nbsp;___________________________________ in [place]________&lt;/p&gt;\r\n\r\n&lt;p&gt;Truthfully,&lt;/p&gt;\r\n\r\n&lt;p&gt;Signature&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Addendum to Notice of Infringement:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;List of Allegedly Infringing Listings, Products, or Materials&lt;/p&gt;\r\n\r\n&lt;p&gt;A Note on Reason Codes: When identifying item numbers please use the reasons&amp;nbsp;below. When removing products from the site, Vizagcart will inform Sellers of the&amp;nbsp;specific reason for the removal of their products.&lt;/p&gt;\r\n\r\n&lt;p&gt;Select the most appropriate reason. Please associate each item you report with&amp;nbsp;only one reason code.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Trademark-infringement&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Trademark owner doesn\'t make this type of product or has discontinued the&amp;nbsp;production of the product&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Item(s) is an unlawful replica of a product made by the trademark owner or is&amp;nbsp;counterfeit&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Trademark-listing description infringement&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Listing(s) has unlawful comparison to trademark owner\'s brand or product&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Listing(s) contains unlawful use of trademark owner\'s logo&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Copyright-item infringement&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Software is being offered without any license or in violation of a license&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Item(s) is a bootleg recording;&lt;/p&gt;\r\n\r\n&lt;p&gt;7. Item(s) is an unlawful copy (software, games, movies, etc.);&lt;/p&gt;\r\n\r\n&lt;p&gt;8. Item(s) is unlawful duplication of printed material&lt;/p&gt;\r\n\r\n&lt;p&gt;9. Item(s) is an unlawful copy of other copyrighted work (paintings, sculptures,&amp;nbsp;etc.)&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Copyright-listing content infringement&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;9. Listing(s) comprises unauthorized copy of copyrighted text&lt;/p&gt;\r\n\r\n&lt;p&gt;10. Listing(s) comprises unauthorized copy of copyrighted image&lt;/p&gt;\r\n\r\n&lt;p&gt;11. Listing(s) comprises unauthorized copy of copyrighted image and text&lt;/p&gt;\r\n\r\n&lt;p&gt;Reason&amp;nbsp;Code:&amp;nbsp;_____________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;Work(s)&lt;/p&gt;\r\n\r\n&lt;p&gt;Infringed: _________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;Item&amp;nbsp;Number(s):&amp;nbsp;___________________________________________________________&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Note:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Please provide the ownership of Trademark (Trademark Registration Certificate&amp;nbsp;should be in the name of applicant)&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Please provide the evidence as to the ownership of copyright.&lt;/p&gt;\r\n\r\n&lt;p&gt;All such Notices of Infringement shall be sent to vizagcart@gmail.com&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('3', '1', 'Privacy Policy', '&lt;p&gt;&lt;strong&gt;Privacy Policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;We value the trust you place in &lt;a href=&quot;http://www.vizagcart.com/&quot;&gt;Vizagcart&lt;/a&gt; , That\'s why we insist upon the highest standards for secure transactions and customer information privacy. Please read the following statement to learn about our information gathering and dissemination practices. Please Note: In order to provide our customers with the best possible services, our policies will be governed by this and going further the privacy policy would be updated on a regular basis to reflect the same. We would request you to please review this policy periodically, to be aware of any changes. By accepting the Privacy Policy during registration, you expressly consent to our use and disclosure of your personal information in accordance with this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Collection of Personally Identifiable Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;We collect personally identifiable information (email address, name, phone number, etc.) from you when you set up a free account with Vizagcart.com. While you can browse some sections of our site without being a registered member, certain activities (such as placing an order) do require registration. You would be receiving offers and mailers from us, in case you do not wish to receive, you can choose to unsubscribe from the same.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Use of Demographic and Profile Data&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;We use personal information to provide the services you request.The information given by you will be used to provide you with the services offered on our website. We use your personal information to resolve disputes; troubleshoot problems; help promote a safe service; collect fees owed; measure consumer interest in our products and services, inform you about online and offline offers, products, services, and updates; customize your experience; detect and protect us against error, fraud and other criminal activity; enforce our terms and conditions; and as otherwise described to you at the time of collection. In our efforts to continually improve our product and service offerings, we collect and analyze demographic and profile data about our user’s activity on our website. We identify and use your IP address to help diagnose problems with our server, and to administer our website. Your IP address is also used to help identify you and to gather broad demographic information. We will occasionally ask you to complete optional online surveys. These surveys may ask you for contact information and demographic information (like zip code, age, or income level). We use this data to tailor your experience at our site, providing you with content that we think you might be interested in--and to display content according to your preferences.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Cookies&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Presently, No Cookies were used .&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;sub&gt;&lt;strong&gt;What are cookies ?&lt;/strong&gt;&lt;/sub&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;sub&gt;&lt;strong&gt;Also known as browser cookies or tracking cookies, cookies are small, often encrypted text files, located in browser directories&lt;/strong&gt;&lt;/sub&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Sharing of personal information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;We may share personal information with our other corporate entities and affiliates to: help detect and prevent identity theft, fraud and other potentially illegal acts; correlate related or multiple accounts to prevent abuse of our services; and to facilitate joint or co-branded services that you request where such services are provided by more than one corporate entity. Those entities and affiliates may not market to you as a result of such sharing unless you explicitly opt-in. We may disclose personal information if required to do so by law or in the good faith belief that such disclosure is reasonably necessary to respond to subpoenas, court orders, or other legal process. We may disclose personal information to law enforcement offices, third party rights owners, or others in the good faith belief that such disclosure is reasonably necessary to: enforce our Terms or Privacy Policy; respond to claims that an advertisement, posting or other content violates the rights of a third party; or protect the rights, property or personal safety of our users or the general public. Vizagcart.com and its affiliates will share some or all of your personal information with another business entity should we (or our assets) plan to merge with, or be acquired by that business entity. Should such a transaction occur that other business entity (or the new combined entity) will be required to follow this privacy policy with respect to your personal information.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Links to Other Sites&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Our site links to other websites that may collect personally identifiable information about you. Vizagcart.com is not responsible for the privacy practices or the content of those linked websites.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Security Precautions&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Our site has stringent security measures in place to protect the loss, misuse, and alteration of the information under our control. Whenever you change or access your account information, we offer the use of a secure server. Once your information is in our possession we adhere to strict security guidelines, protecting it against unauthorized access.We will endeavor to safeguard the confidentiality of your personal information; transmissions made by means of the Internet cannot be made absolutely secure. By using this Site, you agree that we will have no liability for disclosure of your information due to errors in transmission or unauthorized acts of third parties.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Products &amp;amp; Accessories Confirmation&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;As a policy on receipt of product, we request you to check and confirm the contents while accepting the delivery.Discrepancies, if any, must be brought to our notice, after which no further queries would be entertained. Kindly email us on vizagcart@gmail.com or alternatively call on +918297 24 7 365&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Warranty&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;For all products procured from &lt;a href=&quot;http://www.vizagcart.com&quot; target=&quot;_blank&quot;&gt;Vizagcart.com&lt;/a&gt; , warranty and service are provided by the manufacturing companies through their authorized service providers in India.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;&lt;sub&gt;1Year Extra VizagCart.com Warranty&lt;/sub&gt;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;After Sales Service&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;We believe in providing our customer with the best and request you to kindly revert to us for any service related issues.The same would be followed up with the resp. manufacturing companies and we will ensure the service be made available to you as per the turnaround time wherever we are present.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Questions?&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Questions regarding this statement should be directed to the following email id: cu@vizagcart.com&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Disclaimer&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart.com makes every effort to present correct data and timely information regarding the products on sale on our website. However discrepancies, if any, may arise due to inaccurate/incomplete information given suppliers or external sources. In case you come across any such information termed inaccurate, we would request you to kindly inform us at privacy@vizagcart.com&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Disclaimers of Warranty and Product Liability.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart.com will not be held liable for any damaged goods or injuries arising from the using the same. Warranties of products are provided by the Manufacturers and are liable for the same. Product information available on our website would be limited to the information given by the Manufacturer to us. Actual dimensions and colors may differ from the images shown on our website.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Liability of Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart.com nor any of its sources would be liable for any direct, special, incidental, indirect, or consequential damages whatsoever (including but not limited to: damages for loss of business profits, business interruption, loss of business information, or any other pecuniary loss) arising out of the use of the information made available on this web site.&lt;/p&gt;\r\n\r\n&lt;p&gt;Information on the Vizagcart.com web site may not be reproduced, copied, or altered without the express written consent of Vizagcart.com and its affiliates.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Termination&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart.com may terminate this Agreement and these terms and conditions and/or the provision of any of the services at any time for any reason, including any improper use of this portal or your failure to comply with these terms and conditions. Such termination shall not affect any right to relief to which Vizagcart.com and its third party providers and distributors may be entitled, at law or in equity. Upon termination of this User Agreement and these terms and conditions, all rights granted to you will terminate and revert to Vizagcart.com and its third party providers, as applicable&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;No resale of service&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;You agree not to reproduce, duplicate, copy, sell, resell or exploit for any commercial purposes, any portion of the Service, use of the Service, or access to the Service.&lt;/p&gt;\r\n');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('9', '1', 'Cancellation Policy', '&lt;p&gt;&lt;strong&gt;Cancellation Policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li&gt;Order cancellation can be requested through an Email : cu@vizagcart.com&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; OR&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Through helpline number: &lt;/span&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;+91 8297 247 365&lt;/span&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;, Providing the &lt;strong&gt;Order ID&lt;/strong&gt; and Reason for the cancellation.&lt;/span&gt;​&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li&gt;Cancellations will be considered only if the request is made within 12 hours of placing an order. However, the cancellation request will not be entertained if the orders have been communicated to the vendors/merchants and they have initiated the process of shipping them.&lt;/li&gt;\r\n\t&lt;li&gt;Customer refused to take the delivery, cancellation would not be applicable incase of perishable products, like flowers, cakes, food, Chocolates etc.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;sub&gt;The order may be cancelled before shipment due to any of the following reasons:&lt;/sub&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li&gt;The specific product/model is out of Stock.&lt;/li&gt;\r\n\t&lt;li&gt;The order could not be shipped within the specified timeline.&lt;/li&gt;\r\n\t&lt;li&gt;On customers request (Within 12hrs of placing the order).&lt;/li&gt;\r\n\t&lt;li&gt;The shipping address is not available.&lt;/li&gt;\r\n\t&lt;li&gt;Any other reason beyond the control of merchants or Vizagcart.com&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('8', '1', 'Return and Refund Policy ', '&lt;p&gt;&lt;strong&gt;30 Day Replacement Guarantee&lt;/strong&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\nThe 30 Day Replacement Guarantee seeks to assist Buyers who have been defrauded by qualified sellers on the Website. If at the time of delivery and/or within 30 days from the date of delivery of the product/s, if any defect is found, then the buyer of the product/s can ask for replacement of the product/s from the seller subject to the following terms and conditions:&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n\t&lt;li&gt;Notify seller of any defects in the product/s at the time of delivery of the product/s and/or within 30 days from the date of delivery and the same product/s will be replaced in return of the defective product/s.&lt;/li&gt;\r\n\t&lt;li&gt;Replacement can be for the entire product/s or part/s of the product subject to availability of the same with the seller.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Following products shall not be eligible for return or replacement:&lt;/strong&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n• Damages due to misuse of product;&lt;br /&gt;\r\n• Incidental damage due to malfunctioning of product;&lt;br /&gt;\r\n• Any consumable item which has been used/installed;&lt;br /&gt;\r\n• Products with tampered or missing serial/UPC numbers;&lt;br /&gt;\r\n• Digital products/services (Flyte music downloads)&lt;br /&gt;\r\n• Any damage/defect which are not covered under the manufacturer\'s warranty&lt;br /&gt;\r\n• Any product that is returned without all original packaging and accessories, including the box, manufacturer\'s packaging if any, and all other items originally included with the product/s delivered;&lt;br /&gt;\r\n• Jewelers which is \'made to order\' on customer\'s request&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;On Clothing, Footwear and Jewelers, qualified sellers accept 30 day exchange subject to the following conditions:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Clothes and footwear are not used (other than for trial), altered, washed, soiled or damaged in any way.&amp;nbsp;&lt;br /&gt;\r\nOriginal tags and packaging should be intact. For items that come in branded packaging, the box should be undamaged.&lt;br /&gt;\r\n\'Made to order\' jewelers, Innerwear, lingerie, socks and clothing freebies are not covered under the return policy.&amp;nbsp;&lt;br /&gt;\r\nDamaged or defective clothing and footwear products are meanwhile covered by the 30 Day Replacement Guarantee.&lt;/p&gt;\r\n\r\n&lt;p&gt;If Vizagcart has suspicion or knowledge, that any of its buyers and sellers are involved in any activity that is intended to provide claims or information that is false, misleading or not genuine, then Vizagcart may while reserving its rights to initiate civil and/or criminal proceedings against member may also at its sole discretion suspend, block, restrict, cancel the Display Name of such buyer and seller and /or disqualify that user and any related users from availing protection through this program.&lt;/p&gt;\r\n\r\n&lt;p&gt;Vizagcart reserves its right to initiate civil and/or criminal proceedings against a user who, files a invalid and/or false claims or provides false, incomplete, or misleading information. In addition to the legal proceedings as aforesaid, Vizagcart may at its sole discretion suspend, block, restrict, cancel the Display Name [and its related Display Names] of such user and/or disqualify that user and any related users from availing protection through this program. Any person who, knowingly and with intent to injure, &amp;nbsp;defraud or deceive, files a Fraudulent Complaint containing false, incomplete, or misleading information may be guilty of a criminal offence and will be prosecuted to the fullest extent of the law.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Refunds&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;www.vizagcart.com&lt;/strong&gt;&amp;nbsp;accepts &lt;strong&gt;Visa&lt;/strong&gt;, &lt;strong&gt;MasterCard&lt;/strong&gt;, &lt;strong&gt;Mastro&lt;/strong&gt;,&amp;nbsp;&lt;strong&gt;&lt;u&gt;American Express&lt;/u&gt;&lt;/strong&gt;, select&amp;nbsp;&lt;strong&gt;&lt;u&gt;Debit Cards&lt;/u&gt;&lt;/strong&gt;, &lt;strong&gt;Net Banking&lt;/strong&gt;, &lt;strong&gt;Cheque/DD&lt;/strong&gt;, &lt;strong&gt;Bank Transfer&lt;/strong&gt; and &lt;strong&gt;Direct Bank Deposits&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;If the payment was made&amp;nbsp;(Paid through credit card/debit card/Netbanking), the amount is refunded in the same account as you had made payment.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Debit Card/Credit Card/Net Banking - 7-10 working days from the refund initiation date.&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('10', '1', 'Become a Seller', '&lt;h1 class=&quot;lightText letterspacing&quot; style=&quot;border: 0px; outline: 0px; font-weight: 800; font-size: 35pt; font-family: \'Open Sans\', Arial, sans-serif; vertical-align: baseline; margin: 0px; padding: 0px; line-height: 42px;  text-align: center;&quot;&gt;Sell on Vizagcart Marketplace&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;auto standardWidth&quot; id=&quot;intro&quot; style=&quot;border: 0px; outline: 0px; font-size: 28px; font-family: \'Open Sans\', Arial, sans-serif; vertical-align: baseline; margin: 25px auto 70px; padding: 0px; line-height: 32px;  text-align: center;&quot;&gt;\r\n&lt;p style=&quot;border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;&quot;&gt;Join hundreds of merchants selling their items&lt;br /&gt;\r\non vizag\'s largest online shopping&amp;nbsp;platform!&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p style=&quot;margin-left: 320px;&quot;&gt;&amp;nbsp; &amp;nbsp; ​&lt;sup&gt;&lt;strong&gt;&lt;a href=&quot;https://docs.google.com/forms/d/1kjrnE2MDV0cbZuPUetQErv2FaINWQGh2dK8Q_nXuurk/viewform&quot; target=&quot;_blank&quot;&gt;&lt;input class=&quot;button&quot; type=&quot;button&quot; value=&quot;Start Selling On Vizagcart &quot; /&gt;&lt;/a&gt;&lt;/strong&gt;&lt;/sup&gt;&lt;/p&gt;\r\n');
