INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`, `custom_title`, `u_title`, `u_h1`, `u_h2`) VALUES ('52', '1', 'Square led Downlighter10w', '&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Ideal replacement of 2x13W / 2x18W CFL fixture Offices&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Extra long lifetime, used in&amp;nbsp;&amp;nbsp;Commercial Buildings&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;·&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Controlled distribution, ideal for Hospitals workspace illumination.&lt;span style=&quot;line-height: 1.6em;&quot;&gt;· &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;General&amp;nbsp;:&amp;nbsp;CRI&amp;gt;70,•&amp;nbsp;&amp;nbsp; &amp;nbsp;Available in 2700K , 4000K &amp;amp; 6500K&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;Wattage :&amp;nbsp;10W&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;Lifetime :&amp;nbsp;50000 hours&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;Color Temperature:&amp;nbsp;6500K(White) /4000K (Off White) / 2700K (Yellow)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.75pt;&quot;&gt;Lumens&amp;nbsp;&amp;gt;75/Watt&lt;/p&gt;\r\n', 'High KIT AURIO SQUARE Down Light Performance” light quality for General Illumination purpose in Office, commercial applications, to replace CFL fixtures ', 'LED downlighter,  lighting solutions', 'LED Downlighter, KIT AURIO LED\'s, OSRAM LED lightning.', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`, `custom_title`, `u_title`, `u_h1`, `u_h2`) VALUES ('53', '1', 'LED Downlighter-15W', '&lt;p&gt;‘’High KIT AURIO SQUARE Down Light Performance” light quality for General Illumination purpose in Office, commercial applications, to replace CFL fixtures.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Ideal replacement of 2x13W / 2x18W CFL fixture Offices&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Extra long lifetime ,&amp;nbsp;&lt;/p&gt;\r\n', 'low energy consuming lighting system for commercial, office, residential, public utilities, ', 'LED downlighter, Aurio downlighter, lighting solutions, low energy lighting solutions ', 'LED Downlighter, KIT AURIO LED\'s, OSRAM LED lightning.', '', '', '', '');
