y 3W/5W/6.5W/9W &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;General&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; line-height: normal;&quot;&gt;Dia 9.4cm*6.8cm（Dia3.7*2.68inch)&lt;/span&gt;&lt;/p&gt;\r\n', 'OSRAM LED COMFO Downlights ', 'LED downlights, lighting solutions,OSRAM Lightings.', 'LED comfo downlighter 9W,OSRAM Lightings', '', '', '', '');
