adding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Technical&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Wattage &amp;nbsp; &amp;nbsp;0.5W&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Other Details&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Color Temperature &amp;nbsp; &amp;nbsp;3000K-3500K&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Lifetime &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;30,000 hours&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;&lt;span style=&