ilability 3W/5W/6.5W/9W &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;General &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Dia 9.4cm*6.8cm (Dia3.7*2.68inch)&lt;/span&gt;&lt;/p&gt;\r\n', 'Low energy consuming lighting systems for residential, commercial and public services', 'LED Comfo downlight, ceiling light, low energy light, home lighting.', 'LED, comfo,downlighter,OSRAM,Lightings', '', '', '', '');
