; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;Performance&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;The slim body of this XOLO device packs a powerful performer in the&amp;nbsp;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;1.2 GHz Quad Core&lt;/strong&gt;&amp;nbsp;processor that is assisted by 1 GB RAM to ensure that app launches, games and even browsing through the phone is easier and faster. Multitasking is made quicker as well, allowing you to do more with less and unprecedented crashes and lags are a thing of the past. What’s more, with 312 MHz graphics, games that you play are fast, furious, crisp and very responsive.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;An Android device through and through, the&amp;nbsp;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;Jelly Bean v4.2&lt;/strong&gt;&amp;nbsp;gives you the freedom to personalize your phone while bringing small but very useful tweaks like bundled notifications, simpler interface and more accurate predictive input for a well-rounded and intuitive experience.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2p