 line-height: inherit; vertical-align: baseline;&quot;&gt;XOLO Secure - Anti theft App&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;4-inch TFT Display with 233 ppi&lt;/span&gt;&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;1400 mAh Battery Capacity&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;A smartphone that doubles as an everyday companion and a full time entertainer when you need it to be, XOLO offers the A500S that packs a definite punch that you will not soon let go of.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;Smooth and speedy performance&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;For all those times you need an app to launch fast, the GPS to work well and multitask without the phone crashing, the XOLO smartphone packs a 1.3 GHz Dual Core CPU and Mali 400 MP GPU that not only lessens lag but also provides an immersive gaming experience. With ample battery backup provided by the 1400 mAh powerhouse, the phone is sure to make itself indispensable in your life.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;233 PPI display&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;With a 4 inch TFT touchscreen that comes with a pixel density of 233 ppi, the wide resolution, the phone makes everything seem close to reality - crisp, sharp and stunning. Bring your favourite music video to life or just be mesmerized by the clarity of your wallpaper – the phone shows you what is rather than a projection of it.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;X-Themes&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;Customize your phone to be uniquely yours, a device that reflects your moods with a plethora of themes that comes with the smartphone. You can also download compatible ones from online.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;XOLO Secure&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin: 0px 0px 10px; padding: 0px 2px 0px 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;Even if the unscrupulous manage to get their hands on your XOLO A500S, prevent loss of data and recover the device easily as XOLO Secure backs everything up including the thief’s call logs, SMS and such and also tracks it remotely to let you know the exact location so that you can retrieve it.&lt;/p&gt;\r\n&lt;/div&gt;\r\n', 'XOLO A500S\r\n(Black),buy xolo mobiles online,xolo mobiles online,best xolo movies are available at vizagcart.com\t', 'XOLO A500S\r\n(Black),xolo mobiles,best xolo mobiles,cheap xolo mobiles,mobiles online,best mobiles online,xolo mobile online', 'XOLO A500S (Black)', '', '', '', '');
