: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;iOS 8&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;8 MP Primary Camera&lt;/li&gt;\r\n\t&lt;li style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;Wi-Fi Enabled&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', 'Apple iPhone 6(Space Grey, with 16 GB)', 'Apple iPhone 6(Space Grey, with 16 GB)', 'Apple iPhone 6(Space Grey, with 16 GB)', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`, `custom_title`, `u_title`, `u_h1`, `u_h2`) VALUES ('80', '1', 'LED substiTUBE Trio 15w', '&lt;p&gt;Product benefits&amp;nbsp;&lt;br /&gt;\r\nQuick, simple and safe replacement without rewiring&lt;br /&gt;\r\nLow maintenance costs thanks to long lifetime&lt;br /&gt;\r\nEnergy savings of up to 65 % (compared to T8 fluorescent lamp on CCG)&lt;br /&gt;\r\nInstant-on light, therefore ideally suitable in combination with sensor technology&lt;br /&gt;\r\nMaximum resistance to switching loads&lt;br /&gt;\r\nCorrect operation even at low temperatures&lt;br /&gt;\r\nAreas of application&amp;nbsp;&lt;br /&gt;\r\nCooling and storage rooms&lt;br /&gt;\r\nCorridors, stairways, parking garages&lt;br /&gt;\r\nIdeal for simple lighting&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Technical &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Wattage 15W&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Other Details &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Color Temperature 3000 K &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Lumens 1080 lm General Energy consumption - 14 kWh/1000h dimensions &amp;amp; weight: &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal;&quot;&gt;Overall length - 603.2 mm Length - 603.2 mm Tube diameter - 27.5 mm Base diameter - 27.5 mm Product weight - 100.00 g Maximum diameter - 28.0 mm Colors &amp;amp; materials Mercury-free - Yes Temperatures: Ambient temperature range - 20…+45 °C Temperature range in operation -20…75 °C Temperature range at storage -20…80 °C Lifespan - Nominal lamp life time 40000 h Rated lamp life time 40000 h Number of switching cycles 200000 Capabilities: Dimmable - No&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n', 'low wattage LED tube light for residential, commercial, public homes.  ', 'LED Tube lighting, bright room lighting, low wattage tube light', 'LED tube light, Tube lighting', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`, `custom_title`, `u_title`, `u_h1`, `u_h2`) VALUES ('142', '1', 'Tank Water Level Indicator with overflow buzzer alarm + 18 month total servicing', '&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;The overhead tank water level indicator with overflow buzzer works on 230V AC Mains Power Supply .&amp;nbsp; It works much efficiently with its better circuit design.&lt;br /&gt;\r\n&lt;br /&gt;\r\nEasy Installation procedure. No skilled electrician needed. Can be fixed at kitchen&amp;nbsp; for easy monitoring the tank water level status.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;u&gt;&lt;font size=&quot;4&quot;&gt;Step 1&lt;/font&gt;&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;Attache the 6 nos. sensor to the device with any type of thin wire (no high gauge wire is needed, as no current flow through the sensor)&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;br /&gt;\r\n&lt;font size=&quot;4&quot;&gt;&lt;u&gt;&lt;font size=&quot;4&quot;&gt;Step 2&lt;/font&gt;&lt;/u&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;Place the sensor in the water tank at different height level from bottom ( water tank sensor layout is given in the manual)&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;u&gt;&lt;font size=&quot;4&quot;&gt;Step 3&lt;/font&gt;&lt;/u&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;Plug the device two pin plug to the 230vac main power supply.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;&lt;font size=&quot;4&quot;&gt;now your device is ready to show your water tank&amp;nbsp; water level status.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;At any time water level may be seen&amp;nbsp; by pressing switching on the device&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nWhen pump runs it will show water level rising in the tank by means of glowing LEDs in upward direction and vice-versa. When tank is full , all the LEDs (RED, GREEN &amp;amp; BLUE) will glow. Red led is very sensitive to eye and it is for low water level indication. Greens are for intermediate water level and Blue is for full tank indication.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nwhen the tank is just going to overflow......the buzzer of the device gives continuous sounds telling you to switch off the pump to avoid overflow from the tank&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nit has Buzzer on/Off switch.&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;font size=&quot;4&quot;&gt;if you need tank water level indicator for sump ( in this case the buzzer will produce sound when sump is going to empty/buzzer fixed at low water level), please mail me after placing order.&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;br /&gt;\r\n&lt;font size=&quot;4&quot;&gt;it is a device of great value in case of saving precious Electricity and Water.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nSeveral times tested.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n6 nos. Sensors with 5 LED Indicator to show 20%, 40%,60%,80% &amp;amp;100% water level in the tank&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\nAny&amp;nbsp; metal piece (like nut-bolt,1 sq. inch size metal sheet , battery clip, pins of two pin plug etc. ) may be used as sensor probe in the Water tank.&amp;nbsp; 6 nos. metal as sensors piece will be provided with the device.&lt;/font&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;span style=&quot;color: rgb(51, 55, 69); font-family: Helvetica, Arial, sans-serif; font-size: 12.7272720336914px; line-height: normal;&quot;&gt;General :&amp;nbsp;Packages Includes:- 1) 1 no. Domestic overhead tank water level indicator device 2) Mobile Charger Adaptor- 5-6volt/100ma (No free service for adaptor) 3) 6 nos. metal piece as sensor probes - See more at: http://www.vizagcart.com/index.php?route=product/product&amp;amp;path=61_71&amp;amp;product_id=142#sthash.dxr49Oua.dpuf&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal;&quot;&gt;&lt;strong style=&quot;font-size: large;&quot;&gt;Note:- The Device can be used for a distance of 200 meter from water tank. it has strong sense reading capability.&lt;/strong&gt;&lt;/p&gt;\r\n', 'Tank Water Level Indicator with overflow buzzer alarm + 18 month total servicing', 'Tank Water Level IndicatoR', 'semi automatic water level controller, fully automatic waterlevel controlling system', '', '', '', '');
